import React from 'react';

import ImgJs from 'src/assets/services/js.png';
import ImgJava from 'src/assets/services/js.png';

import {
  Container,
  ContentContainer,
  TitleContainer,
  ParagraphContainer,
  ImageContainer,
  ImageService,
} from './styles';

// import { Container } from './styles';

const Services: React.FC = () => {
  return (
    <Container>
      <ContentContainer>
        <TitleContainer>Services</TitleContainer>
        <ImageContainer>
          <ImageService src={ImgJs} />
        </ImageContainer>
      </ContentContainer>
    </Container>
  );
};

export default Services;
